import java.util.ArrayList;
import java.util.HashMap;

public class OrdersManager {
    HashMap<String, ArrayList<Double>> customersOrders;

    public OrdersManager() {
        customersOrders = new HashMap<>();
        ArrayList<Double> orders = new ArrayList<>();
        orders.add(154.43);
        orders.add(5453.98);
        orders.add(8776.65);
        customersOrders.put(" .", orders);

        orders = new ArrayList<>();
        orders.add(25343.54);
        orders.add(420.50);
        customersOrders.put(" .", orders);

        orders = new ArrayList<>();
        orders.add(325.90);
        customersOrders.put(" .", orders);

        orders = new ArrayList<>();
        orders.add(253.54);
        orders.add(420.50);
        customersOrders.put(" .", orders);

        orders = new ArrayList<>();
        orders.add(780.54);
        orders.add(420.50);
        orders.add(36343.54);
        orders.add(2000.50);
        customersOrders.put(" .", orders);
    }

    void printAllOrders() {
        for (String name : customersOrders.keySet()) { //     
            System.out.println(" " + name + ":");
            ArrayList<Double> value = customersOrders.get(name);
            System.out.println(value);
        }
    }

    double getOrdersSum() {
        double sum = 0;
        for (ArrayList<Double> orders : customersOrders.values()) { //      
            for (double orderPrice : orders) {
                sum += orderPrice;
            }
        }
        return sum;
    }

    void printCustomerOrders(String customerName) {
        if (customersOrders.containsKey(customerName)) { // ,      
            System.out.println(" " + customerName + ":");
            System.out.println(customersOrders.get(customerName));
        }
    }

    String getMaxOrderCustomerName() {
        double maxOrder = 0;
        String customerName = "";
        double sum = 0;
        for(String name : customersOrders.keySet()){

            for(double expense : customersOrders.get(name)){
                sum += expense;
                if(sum > maxOrder){
                    maxOrder = sum;
                    customerName = name;
                    sum = 0;
                }

            }
        }
        //    

        return customerName;
    }

    void removeUnprofitableOrders() {
        ArrayList<String> names = new ArrayList<>();
        //   names
        for (String nam : customersOrders.keySet()) {

            double ordersSum = 0;
            for(Double ord : customersOrders.get(nam)){
                ordersSum += ord;
            }
            if(ordersSum < 5000){ names.add(nam); }
        }

        for (String name : names){

            customersOrders.remove(name);
            System.out.println(" " + name + "    .");
        }

        //   - ,     5000


    }
}

