class Solution {

    auto getKoef() {
        static unsigned koef[1 + 'z'] = {};
        if (koef[0] == 0) {
            mt19937 gen(2202);
            for (char c = 'a'; c <= 'z'; c++) {
                koef[c] = uniform_int_distribution<unsigned>(1e9, 2e9)(gen);
            }
        }
        return koef;
    }

public:

    vector<int> findAnagrams(string_view s, string_view p) {
        if (s.size() < p.size()) {
            return {};
        }
        vector<int> ans;
        const auto koef = getKoef();
        unsigned sum = 0; // char of p -, chars of s +, multiply by koef 
        for (char c : p) {
            sum -= koef[c];
        }
        for (int i = 0; i < (int)p.size(); i++) {
            char c = s[i];
            sum += koef[c];
        }
        if (sum == 0) {
            ans.push_back(0);
        }
        for (int i = (int)p.size(); i < (int)s.size(); i++) {
            char toRemove = s[i - (int)p.size()];
            char toAdd = s[i];
            sum -= koef[toRemove];
            sum += koef[toAdd];
            if (sum == 0) {
                ans.push_back(i - (int)p.size() + 1);
            }
            }
            return ans;
        }
    
};

using System.Collections;
using System.Collections.Generic;
using UnityEngine;

public class movement : MonoBehaviour
{
    [SerializeField] CharacterController controller; //  Character Controller
    [SerializeField] float speed = 5f; // 
    private Vector3 direction; //   
    [SerializeField] float jumpForce = 5f; //  
    [SerializeField] float gravity = 10f;// 
    // Start is called before the first frame update
    void Start()
    {
        
    }

    // Update is called once per frame
    void Update()
    {
        float moveHorizontal = Input.GetAxis("Horizontal"); //        ,    A,D
        float moveVertical = Input.GetAxis("Vertical"); //        ,    W,S

        if(Input.GetKey(KeyCode.LeftShift))//   Shift
        {
            speed = 10;
        }
        if (Input.GetKeyUp(KeyCode.LeftShift))//       
        {
            speed = 5;
        }

        if (controller.isGrounded) //     
        {
            direction = new Vector3(moveHorizontal, 0, moveVertical); // moveHorizontal    x, moveVertical  z, Y     
            direction = transform.TransformDirection(direction) * speed; //      speed,      
            if (Input.GetKeyDown(KeyCode.Space))
            {
                direction.y = jumpForce; //   Space   
            }
        }

        direction.y -= gravity * Time.deltaTime; // 
        controller.Move(direction * Time.deltaTime); //  
        
    }
}

