Random          PROC    NEAR                            ;
		SAVE    DS                              ;
		MOV_S   DS,CS                           ;
		SAVE    BX,CX,DX,AX                     ;
		MOV     CX,7                            ;
		MOV     BX,offset LastRandom            ;
