		comment                                 #
									      ?
	Zeichen und Attribut aus Videospeicher auslesen.                        
										
		#                                       ;
Load_from_VRAM  PROC    NEAR                            ;
		SAVE    SI,DS,DX                        ;
		MOV     AL,DH                           ;
		MUL     [Num_of_Col]                    ;
		MOV     DH,0                            ;
		ADD     AX,DX                           ;
		SHL     AX,1                            ;
		ADD     AX,[Page_offset]                ;
		MOV     SI,AX                           ;
		TEST    [Prevent_Snow?],-1              ;
		MOV     DS,[Seg_of_VRAM]                ;
		JZ      XI_038                          ;
		Wait_HRI_or_VRI                         ;
XI_038:         LODSW                                   ;
		STI                                     ;
		REST    DX,DS,SI                        ;
		RET                                     ;
Load_from_VRAM  ENDP                                    ;
		comment                                 #
									      ?
	Zeichen und Attribut (AX) in den Videospeicher schreiben.               
										
		#                                       ;
Write_to_VRAM   PROC    NEAR                            ;
		SAVE    DI,ES,DX,BX                     ;
		MOV     BX,AX                           ;
		MOV     AL,DH                           ;
		MUL     [Num_of_Col]                    ;
		MOV     DH,0                            ;
		ADD     AX,DX                           ;
		SHL     AX,1                            ;
		ADD     AX,[Page_offset]                ;
		MOV     DI,AX                           ;
		TEST    [Prevent_Snow?],-1              ;
		MOV     ES,[Seg_of_VRAM]                ;
		JZ      XI_039                          ;
		Wait_HRI_or_VRI                         ;
XI_039:         MOV     AX,BX                           ;
		STOSB                                   ;
		STI                                     ;
		REST    BX,DX,ES,DI                     ;
		RET                                     ;
Write_to_VRAM   ENDP                                    ;
		comment                                 #
									      ?
	Bit 0 von Port B des 8255 Chips zur cksetzen (IO-Adresse : &H61 ).      
										
		#                                       ;
Toggle_Speaker  PROC    NEAR                            ;
		PUSH    AX                              ;
		IN      AL,PORT_B_8255                  ;
		XOR     AL,02                           ;
		AND     AL,0FE                          ;
		OUT     PORT_B_8255,AL                  ;
		POP     AX                              ;
		RET                                     ;
Toggle_Speaker  ENDP                                    ;
		comment                                 #
									      ?
	CF gesetzt, wenn AL ein nicht darstellbares Zeichen enth lt.            
										
