		comment                                 #
									      ?
	Geschwindigkeit der Maschine ( zur Verwendung in DELAY ) ermitteln.     
										
		#                                       ;
GetSysSpeed     PROC    NEAR                            ;
		PUSH    DS                              ;
		MOV     AX,BIOSDATASEG                  ;
		MOV     DS,AX                           ;
		STI                                     ;
		MOV     AX,[B_TIMERVAR]                 ;
XI_042:         CMP     AX,[B_TIMERVAR]                 ;
		JZ      XI_042                          ;
		XOR     CX,CX                           ;
		MOV     AX,[B_TIMERVAR]                 ;
XI_043:         INC     CX                              ;
		JZ      XI_045                          ;
		CMP     AX,[B_TIMERVAR]                 ;
		JZ      XI_043                          ;
XI_044:         POP     DS                              ;
		MOV     AX,CX                           ;
		XOR     DX,DX                           ;
		MOV     CX,0F                           ;
		DIV     CX                              ;
		MOV     CS:[Speed],AX                   ;
		RET                                     ;
XI_045:         DEC     CX                              ;
		JMP     XI_044                          ;
GetSysSpeed     ENDP                                    ;
		comment                                 #
